import { YStack, XStack, Input, Avatar, Card, H4, Text } from "tamagui";
import { LogOut } from "@tamagui/lucide-icons";
import User from "../../components/User";
import { Button } from "../../components/Button";
import React from "react";
import { useLogin } from "../../context/loginProvider";

export default function Home({ navigation }) {
  const groups = [
    {
      id: 1,
      title: "Grupo do fut",
      type: "Futebol",
      icon: "soccer",
      image:
        "data:image/jpeg;base64,",
    },
    {
      id: 2,
      title: "Bora exercitar",
      type: "Corrida",
      icon: "run",
      image:
        "data:image/jpeg;base64,",
    },
  ];

  const { setIsLoggedIn } = useLogin();

  const handleLoggout = () => {
    setIsLoggedIn(false);
  };

  const handleVizualizarGrupo = (id) => {
    navigation.navigate("Externa",{groupId: id});
  };

  return (
    <YStack bg="$background" f={1} p="$6" pt="$8">
      <XStack jc="space-between">
        <User />
        <Button
          style={{ backgroundColor: "red" }}
          theme="active"
          icon={LogOut}
          circular
          onPress={() => handleLoggout()}
        ></Button>
      </XStack>
      <YStack space p="$3"></YStack>
      <XStack space="$2" mt="$6">
        <Input
          flex={1}
          w="$5"
          h="$5"
          placeholder="Buscar grupos..."
          focusStyle={{
            bw: 2,
            boc: "$red10",
          }}
        />
        <Button background="outline" />
      </XStack>
      <YStack space="$2" mt="$6">
        {groups.map((group) => (
          <Card
            animation="bouncy"
            pressStyle={{ scale: 0.875 }}
            key={group.id}
            backgroundColor="$gray7"
            onPress={() => handleVizualizarGrupo(group.id)}
          >
            <Card.Header padded>
              <XStack space="$2" ai="center">
                <Avatar size="$5" circular>
                  <Avatar.Image src={group.image} />
                  <Avatar.Fallback backgroundColor="$gray5"></Avatar.Fallback>
                </Avatar>
                <YStack>
                  <H4 fontWeight="bold" mt="$-2">
                    {group.title}
                  </H4>
                  <Text>{group.type}</Text>
                </YStack>
              </XStack>
            </Card.Header>
          </Card>
        ))}
      </YStack>
    </YStack>
  );
}
